      result.per = result.per + 1
    }
    // if ...
    if (values[i].z.indexOf('Victoria') != -1) {
      result.vic = result.vic + 1
    }
    else if (values[i].z.indexOf('New South Wales') != -1) {
      result.nsw = result.nsw + 1
    }
    else if (values[i].z.indexOf('Queensland') != -1) {
      result.qs = result.qs + 1
    }
    else if (values[i].z.indexOf('South Australia') != -1) {
      result.sa = result.sa + 1
    }
    else if (values[i].z.indexOf('Tasmania') != -1) {
      result.tas = result.tas + 1
    }
    else if (values[i].z.indexOf('Western Australia') != -1) {
      result.wa = result.wa + 1
    }
    else if (values[i].z.indexOf('Northern Territory') != -1) {
      result.nt = result.nt + 1
    }
    result.count = result.count + 1
  }
  return result
}

